INSERT INTO multilang_academy_sections (`id`,`language_id`, `section_id`,  `title`, `description`) VALUES
('07fc34d6-b494-46d8-91b0-6a948bd00cf7', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '07fc34d6-b494-46d8-91b0-6a948bd00cf7', 'devesting', 'después del choque térmico, es momento de limpiar el árbol. en este módulo te mostramos cómo usar la hidrolavadora de forma eficiente para remover el revestimiento sin dañar la joyería.'),
('0ebd03b7-b904-4d94-9929-89792cfb28d5', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '0ebd03b7-b904-4d94-9929-89792cfb28d5', 'montado de piedras french set', 'aprende a realizar engastes tipo french con detalles refinados. desarrolla precisión al posicionar piedras pequeñas en un patrón elegante.'),
('0f0f069b-30e4-45b7-9215-1db86c7f3234', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '0f0f069b-30e4-45b7-9215-1db86c7f3234', 'pre-pulido con brocha (c1)', 'usa la brocha con pasta abrasiva (c1) para eliminar imperfecciones sin dañar los detalles de la pieza.\n\n'),
('12cdcc90-4aa4-4d91-8042-59cf8e13f51e', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '12cdcc90-4aa4-4d91-8042-59cf8e13f51e', 'reconocimiento', 'módulo dedicado a valorar tu esfuerzo, constancia y mejora. reconoce tu avance en técnica, precisión y resultados.'),
('178bd879-8547-42c0-bd54-d5f4a08d7138', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '178bd879-8547-42c0-bd54-d5f4a08d7138', 'sem 1 interfaz counter sketch designer ', 'explora el entorno visual del software: desde la barra de menús hasta la vista superview y rhinoview. conocer la interfaz te dará control total desde el inicio.'),
('28cdba22-ec79-456a-8e3b-52df3cbef053', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '28cdba22-ec79-456a-8e3b-52df3cbef053', 'proceso completo', 'integra todo lo aprendido realizando el proceso completo de pulido desde el pre-pulido hasta el brillo final.'),
('31db78b6-a1c2-4f5f-b00d-410636e3c0f1', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '31db78b6-a1c2-4f5f-b00d-410636e3c0f1', 'metodo de inspeccion', 'aplicarás una metodología clara y efectiva para realizar inspecciones paso a paso, asegurando consistencia, objetividad y trazabilidad en cada evaluación.'),
('32fd7e1d-2b1f-41e6-a516-7176794808ce', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '32fd7e1d-2b1f-41e6-a516-7176794808ce', 'choque termico ', 'el choque térmico ayuda a fracturar el yeso y liberar el árbol metálico. aprende cómo realizarlo de forma segura para evitar daños en las piezas o deformaciones.'),
('376781e4-4c01-456f-993a-1f0b3dcfcc29', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '376781e4-4c01-456f-993a-1f0b3dcfcc29', 'diagrama de sarampion', 'con esta herramienta visual aprenderás a registrar, analizar y atacar los defectos desde su origen. ¡transforma datos en mejoras reales dentro del proceso!'),
('3bae2c6d-1cdd-47d7-ab47-2ff48c7c6540', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '3bae2c6d-1cdd-47d7-ab47-2ff48c7c6540', 'herramientas de engarce', 'conocerás a fondo cada herramienta del engarzador: su uso, cuidado y función en el proceso. ¡tus manos serán más precisas y tus resultados más profesionales!'),
('46b66a58-615f-4758-a0af-9cf8534265b8', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '46b66a58-615f-4758-a0af-9cf8534265b8', 'tecnica para el  uso del maneral', 'aprenderás la técnica adecuada para manejar el maneral, evitando errores y logrando acabados firmes, estéticos y consistentes.'),
('4a6f472a-dfb5-4c0d-9f75-b42207a71d59', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '4a6f472a-dfb5-4c0d-9f75-b42207a71d59', 'sem 3 herramientas counterskech designer', 'profundiza en builders, surfaces y bails. aprende a construir estructuras completas y superficies a partir de curvas. ¡tu joya empieza a tomar forma!'),
('4ea525cf-fc6a-411d-9eef-fc9bfdd8f237', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '4ea525cf-fc6a-411d-9eef-fc9bfdd8f237', 'montado de piedras single claw prong', 'domina el montaje con una sola garra por piedra. ideal para diseños ligeros, donde se requiere precisión y estética limpia.'),
('53c78114-d1e1-4f7d-a2e5-3f6e0b7d36ad', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '53c78114-d1e1-4f7d-a2e5-3f6e0b7d36ad', 'como afilar buriles', 'aprende a preparar correctamente tus buriles. afilar tus herramientas mejora el control, la seguridad y el acabado final en el proceso de engarce.'),
('5801d2be-9fa2-4283-8dd6-85f5c511e868', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '5801d2be-9fa2-4283-8dd6-85f5c511e868', 'reconocimiento', 'en este módulo celebramos tu constancia y compromiso. reconocemos el conocimiento adquirido y el impacto que generas en cada pieza que engarzas.'),
('5a3f35b6-fe18-4e24-9189-4e2972e1e212', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '5a3f35b6-fe18-4e24-9189-4e2972e1e212', 'bienvenida', '¡bienvenidos al fascinante mundo del casting de joyería! en este curso conocerás paso a paso cómo transformamos ideas en piezas únicas, con precisión, técnica y pasión por el detalle.'),
('5d46ce62-9259-413f-b81e-009db36cb339', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '5d46ce62-9259-413f-b81e-009db36cb339', 'atributos', 'características que provienen de procesos como inyección de cera o casting. no son defectos, pero deben conocerse para evaluar correctamente la pieza.'),
('5d8c0787-814c-4130-b4b4-5abe0a65587a', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '5d8c0787-814c-4130-b4b4-5abe0a65587a', 'defectos', 'errores generados al transformar la pieza (pulido, engarce, etc.). aprenderás a detectarlos, clasificarlos y prevenirlos.'),
('5dece5c1-1dd8-4f6b-a688-1c5feadcd915', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '5dece5c1-1dd8-4f6b-a688-1c5feadcd915', 'conocimientos generales', 'aprenderás los fundamentos del pulido: tipos de abrasivos, velocidades, presión y seguridad para lograr un trabajo de calidad.'),
('5ff227a1-d8a0-4ba5-bf73-11cef34572cb', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '5ff227a1-d8a0-4ba5-bf73-11cef34572cb', 'herramientas de pulido', 'conoce las herramientas esenciales: brochas, pastas y discos. aprende su uso correcto para evitar errores y obtener mejores resultados.'),
('604a7e9d-a7f8-43fd-9419-388b15c3b4c6', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '604a7e9d-a7f8-43fd-9419-388b15c3b4c6', 'bienvenida', 'inicia tu formación en pulido. este curso te guiará paso a paso para dominar cada técnica y obtener acabados profesionales.'),
('65a35c6a-c947-4ed1-85a0-a9c0feb1363b', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '65a35c6a-c947-4ed1-85a0-a9c0feb1363b', 'conocimientos', 'verás conceptos clave como la expansión, contracción y el comportamiento de los materiales en el casting. ¡te ayudará a entender mejor todo el proceso!'),
('6821bdec-a2d0-4f6b-aae0-4f79f7001290', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '6821bdec-a2d0-4f6b-aae0-4f79f7001290', 'falta de proceso', 'cuando una pieza no pasó por una etapa esencial. aprenderás a identificarla aunque no tenga defectos visibles.'),
('6c5926be-3da5-43bc-a71e-ecce0493b16e', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '6c5926be-3da5-43bc-a71e-ecce0493b16e', 'montado de piedras shared prong', 'descubre cómo fijar dos piedras con una sola garra, logrando alineación, firmeza y estética en piezas delicadas con máxima eficiencia.'),
('6d8de92d-22bb-469e-b8d6-a7643b726bd5', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '6d8de92d-22bb-469e-b8d6-a7643b726bd5', 'curado de cubiletes', 'una vez mezclado el yeso, los cubiletes deben ser curados correctamente para lograr una estructura resistente. aquí te mostraremos los tiempos, temperaturas y condiciones ideales de curado.'),
('6eea11df-6a4f-4661-88eb-911f5f9e0305', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '6eea11df-6a4f-4661-88eb-911f5f9e0305', 'ejercicios counter sketch', 'aplica lo aprendido en ejercicios prácticos que te ayudarán a reforzar tu lógica, precisión y habilidad de diseño. ¡el mejor aprendizaje es haciendo!'),
('703be787-656f-439c-93d6-39dbd309c425', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '703be787-656f-439c-93d6-39dbd309c425', 'bienvenida', '¡aquí comienza tu camino en countersketch designer! te damos la bienvenida a un curso diseñado para transformar tus ideas en joyería real.'),
('703cef2e-fe6d-44e7-8c6d-d66f1665dd87', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '703cef2e-fe6d-44e7-8c6d-d66f1665dd87', 'nuevas herramientas', 'conocerás herramientas adicionales para el engarce que te ayudarán a trabajar con más precisión y eficiencia. aprenderás su uso, propósito y cuándo aplicarlas correctamente.'),
('7758a6c0-6ffb-4a41-aaa1-0b7d5835941d', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '7758a6c0-6ffb-4a41-aaa1-0b7d5835941d', 'bienvenida', 'aquí comienza tu camino para convertirte en un experto del engarce. cada módulo está diseñado para impulsarte paso a paso, con claridad, técnica y pasión por el engarce.'),
('7fa024be-a054-4a57-99a7-826573bc334e', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '7fa024be-a054-4a57-99a7-826573bc334e', 'pre-pulido de piezas con palo de fieltro y prepulido', 'descubre cómo usar el palo de fieltro con pasta para preparar superficies planas y curvas antes del pulido final.'),
('808d387d-76ac-4b65-bbec-f7b533956358', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '808d387d-76ac-4b65-bbec-f7b533956358', 'investing', 'verás cómo lograr una mezcla uniforme, sin burbujas, que copie cada detalle de tu modelo de cera.'),
('80e71a41-c2cc-435e-aff9-4394bfd40899', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '80e71a41-c2cc-435e-aff9-4394bfd40899', 'montado de piedras pinpoint', 'este módulo te entrenará para fijar piedras pequeñas con alta precisión, cuidando cada detalle estético y asegurando una fijación segura y eficiente.'),
('8785de92-f262-49df-b494-407c84ed774e', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '8785de92-f262-49df-b494-407c84ed774e', 'accesorios', null),
('8d90fcbc-4075-4131-a6a8-62870d39598e', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '8d90fcbc-4075-4131-a6a8-62870d39598e', 'reconocimiento', 'celebramos tu constancia y compromiso. este módulo reconoce tu progreso y preparación para avanzar hacia técnicas más complejas.'),
('8fc35fa6-0398-4ee6-9765-efebb833a507', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '8fc35fa6-0398-4ee6-9765-efebb833a507', 'montado de piedras center prong', 'aprenderás a montar piedras centrales cuidando su firmeza, simetría y atractivo visual. ¡porque el corazón de la joya debe lucir perfecto!'),
('9019223e-79da-44c9-92c4-102f4959af64', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '9019223e-79da-44c9-92c4-102f4959af64', 'montado de piedras round channel', 'descubre cómo montar piedras en canal redondo, cuidando el alineamiento, la presión y la firmeza de la fijación. ideal para bandas y estilos modernos.'),
('91dc634f-73e9-40cf-a02f-0cd1254973cd', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '91dc634f-73e9-40cf-a02f-0cd1254973cd', 'montado de piedras double claw prong', 'aprende a fijar piedras con doble garra. este método garantiza mayor seguridad y simetría, especialmente en piedras de mayor valor.'),
('9dcdab30-8f5e-4b1f-b26e-81c1afcfd2fd', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', '9dcdab30-8f5e-4b1f-b26e-81c1afcfd2fd', 'conocimientos', 'reforzarás los principios esenciales de la calidad en joyería, comprendiendo el porqué de cada criterio y cómo influye en la percepción y satisfacción del cliente final.'),
('ae305717-c913-415f-86f6-e0b4be9a23a4', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'ae305717-c913-415f-86f6-e0b4be9a23a4', 'preparado de cubiletes', 'el proceso comienza con el correcto preparado de los cubiletes. aquí aprenderás cómo limpiarlos, secarlos y etiquetarlos para garantizar fundiciones exitosas y sin contaminaciones.'),
('b737ad58-5a3c-42f4-bf7d-6240934feb4c', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'b737ad58-5a3c-42f4-bf7d-6240934feb4c', 'pre-pulido de pendantes con dental', 'técnica especializada para pre-pulir piezas colgantes usando herramienta tipo dental, ideal para zonas pequeñas y delicadas.'),
('bcb5bc14-a03a-4c61-b2b3-a2bf8634ded8', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'bcb5bc14-a03a-4c61-b2b3-a2bf8634ded8', 'practicas counter sketch', 'resuelve retos reales de diseño. experimenta con distintos estilos de anillos, gemas, estructuras y funcionalidades. ¡es momento de poner tu creatividad en acción!'),
('be358e10-2d8b-41f4-9fcf-1f050775c931', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'be358e10-2d8b-41f4-9fcf-1f050775c931', 'clipping', 'en este paso final, cortamos las piezas del árbol con precisión. te enseñaremos a utilizar las herramientas adecuadas, cuidando la integridad de cada diseño.'),
('be800f06-f06a-4d7f-b133-bcc07501e8ea', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'be800f06-f06a-4d7f-b133-bcc07501e8ea', 'fundicion', 'aquí ocurre la magia: ¡el metal se transforma! conocerás cómo manejar el horno de fundición, los controles de temperatura y seguridad, y cómo verter el metal en el molde con precisión.'),
('c0967d22-25a5-40fe-bbb8-2da6c0ed6216', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'c0967d22-25a5-40fe-bbb8-2da6c0ed6216', 'sem 2 herramientas counterskech designer', 'aprende el uso de herramientas básicas como curvas, perfiles, gemas y railes. empieza a construir piezas con lógica y precisión desde cero.'),
('c45cb73f-2ed8-44e3-ac2e-956f87b4e667', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'c45cb73f-2ed8-44e3-ac2e-956f87b4e667', 'montado de piedras de engarces combinados', 'aprenderás a montar piezas que combinan distintos tipos de engarce, aplicando todo lo aprendido y llevando tu habilidad al siguiente nivel.'),
('c6a3735f-ae74-4b20-b7a8-afb799da0d21', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'c6a3735f-ae74-4b20-b7a8-afb799da0d21', 'desarrollo de tecnicas de corte', 'en este módulo desarrollarás técnicas clave para realizar cortes limpios y controlados, preparando la pieza con exactitud desde el inicio y asegurando un resultado final impecable.'),
('ceca39f5-1e72-4f25-8f58-307b61e16129', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'ceca39f5-1e72-4f25-8f58-307b61e16129', 'conocimientos para este modulo', 'refuerza conceptos esenciales del engarce. comprende el porqué detrás de cada paso para tomar decisiones técnicas más acertadas al trabajar con joyería.'),
('e82241f1-32d8-4fe0-aceb-cbfb78ff910d', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'e82241f1-32d8-4fe0-aceb-cbfb78ff910d', 'conocimiento', 'en este módulo reforzarás los principios esenciales del engarce, comprendiendo el porqué de cada paso para tomar decisiones más acertadas.'),
('eeb0c527-6a4a-4810-890b-6f05a5e3de0d', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'eeb0c527-6a4a-4810-890b-6f05a5e3de0d', 'bienvenida', 'inicia tu camino como inspector de calidad. este curso te guiará paso a paso con enfoque técnico y práctico para asegurar piezas impecables.'),
('f0fdd2f7-c8ed-435e-8a4e-181385659ccb', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'f0fdd2f7-c8ed-435e-8a4e-181385659ccb', 'herramientas para inspeccion ', 'conocerás a fondo cada herramienta del inspector: su uso, cuidado y función en el proceso. ¡tus ojos serán más agudos y tus manos más seguras al evaluar!'),
('f6d5dc3e-934f-438c-9459-1b67b88b9ade', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'f6d5dc3e-934f-438c-9459-1b67b88b9ade', 'bienvenida', 'te damos la bienvenida a un curso diseñado para formar expertos en engarce. aquí comienza tu camino para dominar las técnicas, herramientas y procesos del montaje de piedras.'),
('f8aa3292-ffe3-4e47-9e6c-5a303fed12ff', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'f8aa3292-ffe3-4e47-9e6c-5a303fed12ff', 'sem 4 herramientas counterskech designer', 'entra al mundo de los detalles: cortes, sólidos, booleanas y scripting. aprende a manipular objetos, combinar formas y llevar tus diseños al siguiente nivel.'),
('fe47c44d-8dd5-4acc-84ab-619c7720c184', 'd3feedb5-c3f6-4fb3-b5f0-25ddf343cd50', 'fe47c44d-8dd5-4acc-84ab-619c7720c184', 'brillo', 'aprende a dar el acabado final usando pastas de brillo, logrando una superficie limpia, pulida y lista para inspección.');
